import React from 'react';
import './App.css';
import TextField from "@material-ui/core/TextField";



class App extends React.Component {

  render(){
    return (
      <div className="App">
        <h1> GETTING STARTED </h1>
        <div> Enter a player's name </div>
        <br/>
        <TextField
          id="outlined-number"
          label="Number"
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
          variant="outlined"
        />
      </div>
    );
  }

}

export default App;
